import React from "react";
import SubTitle from "../atoms/SubTitle";

export default class MeetupNow extends React.Component {
	constructor(){
		super()
		this.state = {
			subtitle: `Members`,
			message: `Come and meet other developers in teh JavaScript and it's library in the Greater Jakarta area`,
			twitter: `@JakartaJs and we use the hashtag #jakartajs`
		};
	}
	render() {
		return (
			<div>
				<div className="flex m-3">
					<SubTitle subtitle = {this.state.subtitle} className="flex-1"/>
					<p className="mr-10">See all</p>
				</div>
				<div className="bg-[#C4C4C4] mx-10 flex">
					<div className="profile-img bg-[#828282] h-16 w-16 m-5 rounded-full"></div>
					<div className="member-desc my-5">
						<h3 className="role text-lg font-medium">Organizers</h3>
						<p className="font-medium">Ardi Wiranata &emsp; <span>4 Others.</span></p>
					</div>
				</div>
			</div>
		)
	}
	
}
